import React from "react";
import images from "../images.json";
import "../App.css";

function Game(props) {
  return (
    <div className="container2">
      {images.map((image, index) => (
        <img src={image.imgUrl} onClick={props.keepScore} />
      ))}
    </div>
  );
}

export default Game;
